DROP TABLE IF EXISTS `nacimiento_bebes`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `nacimiento_bebes` (
  `ID` int NOT NULL COMMENT 'Aqui ira el identificador unico de cada bebe recien nacido',
  `fecha_nacimiento` date DEFAULT NULL COMMENT 'Esta columna almacenaria la fecha en la que ocurrio el nacimiento.',
  `hora_nacimiento` time DEFAULT NULL COMMENT 'Aqui se registraria la hora exacta del nacimiento.',
  `peso` decimal(5,2) DEFAULT NULL COMMENT 'Esta columna registraria el peso del recien nacido en kilogramos, con dos decimales de precision.',
  `longitud` decimal(5,2) DEFAULT NULL COMMENT 'Esta columna registraria la longitud del recien nacido al nacer, probablemente medida en centimetros y almacenada con dos decimales de precision.',
  `nombre_padre` varchar(100) DEFAULT NULL COMMENT 'Almacena el nombre del padre del recien nacido.',
  `nombre_madre` varchar(100) DEFAULT NULL COMMENT 'Almacena el nombre de la madre del recien nacido.',
  `telefono_contacto` varchar(20) DEFAULT NULL COMMENT 'Aqui se almacenaria un numero de telefono de contacto, probablemente para los padres o tutores del recien nacido.',
  `email_contacto` varchar(100) DEFAULT NULL COMMENT 'Esta columna almacenaria una direccion de correo electronico de contacto.',
  `observaciones` text COMMENT 'Se utiliza para almacenar observaciones adicionales o notas relacionadas con el nacimiento o el estado del recien nacido.',
  `tipo_nacimiento` tinyint(1) DEFAULT NULL COMMENT 'Esta columna podria indicar el tipo de nacimiento, por ejemplo, natural o por cesarea.',
  `frecuencia_cardiaca` int DEFAULT NULL COMMENT 'Almacena la frecuencia cardiaca del recien nacido, probablemente medida en latidos por minuto.',
  `temperatura` decimal(4,2) DEFAULT NULL COMMENT 'Esta columna almacenaria la temperatura corporal del recien nacidos, en grados Celsius, con dos decimales de precision.',
  `presion_arteria_sistolica` int DEFAULT NULL COMMENT 'Aqui se almacenaria la lectura de la presion arterial sistolica del recien nacido, medida en milimetros de mercurio (mmHg).',
  `presion_arteria_diastolica` int DEFAULT NULL COMMENT 'Similar a la columna anterior, pero para la presion arterial diastolica del recien nacido.',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
