	IF v_password = "Justin" THEN
	call bd_hospital_210659.sp_insertar_personal_medico(70, null);
    call bd_hospital_210659.sp_insertar_personal_medico(60, "Médico");
    call bd_hospital_210659.sp_insertar_personal_medico(80, "Enfermero");
